/**
 * Given a string, find the first non-repeating character in it and return it's index. If it doesn't exist, return -1.
 * <p>
 * Examples:
 * <p>
 * s = "leetcode"
 * return 0.
 * <p>
 * s = "loveleetcode",
 * return 2.
 * <p>
 * Note: You may assume the string contain only lowercase letters.
 */
public class FirstUniqueCharacterinaString {
    public static void main(String[] args) {
        String str = "";
        System.out.println(firstUniqChar2(str));
    }

    //慢
    public static int firstUniqChar(String s) {
        int length = s.length();
        for (int i = 0; i < length; i++) {
            String oldStr = s;
            char oldChar = oldStr.charAt(i);
            if (length - oldStr.replace(String.valueOf(oldChar), "").trim().length() == 1) {
                return i;
            }
        }
        return -1;

    }

    public static int firstUniqChar2(String s) {
        int length = s.length();
        String oldStr = s;
        while (length > 0) {
            char c = s.charAt(0);
            s = s.replace(String.valueOf(c), "").trim();
            int newLength = s.length();
            if (length == newLength + 1) {
                return oldStr.indexOf(c);
            }
            length = newLength;
        }
        return -1;

    }
}
